import React from 'react';
import '../../App.css';
import  './AboutCont.css';

function AboutCont() {
  return (
    <div className='hero-container'>
      <h1>WELCOME</h1>
      <h5 className='about'>The CSS box model is essentially a 
      box that wraps around every HTML element. 
      It consists of: borders, padding, margins, and the 
      actual content</h5>
    </div>
  )
}
export default AboutCont;
